var App = {};

App.error = function(args) {
	console.error('Error:', args);
    // TODO log to server
};

App.getTime = function() {
    var date = new Date;
    return date.getTime();
};

App.getTimer = function(name) {
    var then = App.getTime();
    return function() {
        return App.getTime() - then;
    };
};

$(function() {
    var $exercise = $('[data-exercise]');
    if (!$exercise.length) {
        return;
    }

    App.onInactive.add(function() {
        $exercise.find('[name=inactivity]').val(true);
    });

    var timer = App.getTimer('exercise');
    $exercise.on('submit', function() {
        $(this).find('[name=time]').val(timer());
    });

    var hints = $exercise.find('[data-hint]').hide().toArray();
    $('[data-show-hint]').click(function() {
        $exercise.find('[name=hint]').val(true);
        $(hints.shift()).show();

        if (!hints.length) {
            $(this).hide();
        }
    });
});

App._idleSince = null;

App._resetIdleTime = function() {
    App._idleSince = App.getTime();
};

App._checkIdle = function() {
    if (App._idleSince === null)
    {
        return;
    }

    var idleFor = App.getTime() - App._idleSince;
    if (idleFor > 60 * 1000)
    {
        App.onInactive.fire();
        App._idleSince = null;
    }
};


App._resetIdleTime();
App.onInactive = $.Callbacks();

$(document).mousemove(App._resetIdleTime);
$(document).keypress(App._resetIdleTime);

setInterval(App._checkIdle, 250);

if (window.location.hash && window.location.hash == '#_=_') {
	window.location.hash = '';
}

/**
 * Removes _fid parameter from url
 * @see http://forum.nette.org/cs/4405-flash-zpravicky-bez-fid-v-url#p43713
 */
if (window.history.replaceState) {
	l = window.location.toString();
	uri = l.indexOf('_fid=');
	if (uri != -1) {
		uri = l.substr(0, uri) + l.substr(uri + 10);
		if ((uri.substr(uri.length - 1) == '?') || (uri.substr(uri.length - 1) == '&')) {
			uri = uri.substr(0, uri.length - 1);
		}
		window.history.replaceState('', document.title, uri);
	}
}

(function() {
    $form = $('#frm-editor-form');
    if (!$form.length) {
        return;
    }

    var Renderer = {};
    Renderer.saveHook = function(def, $input, map) {
        var serialize = function() {
            for (var k in map) {
                def[k] = map[k].val();
            }
            $input.val(JSON.stringify(def));
        };
        for (var k in map) {
            map[k].on('change', serialize);
        }
        serialize();
    };
    Renderer.render = function(def, $input) {
        var $group = $('<div></div>')
            .text('type: ' + def.type);
        $input.hide();
        $input.after($group);

        var method = 'render' + def.type.charAt(0).toUpperCase() + def.type.slice(1);
        Renderer[method](def, $group, $input);
    };
    Renderer.renderInteger = function(def, $group, $input) {
        var $min = $('<input type="number" class="form-control">').val(def.min);
        var $max = $('<input type="number" class="form-control">').val(def.max);
        $group.append($min).append($max);

        Renderer.saveHook(def, $input, {
            'min': $min,
            'max': $max
        });
    };
    Renderer.renderPlural = function(def, $group, $input) {
        var inputs = {};
        var keys = ['count', 'one', 'few', 'many'];
        for (var name in keys) {
            var key = keys[name];
            inputs[key] = $('<input class="form-control">').val(def[key]);
            $group.append(inputs[key]);
        }
        Renderer.saveHook(def, $input, inputs);
    };
    Renderer.renderList = function(def, $group, $input) {
        var inputs = {};
        for (var i in def.list) {
            inputs[i] = $('<input class="form-control">').val(def.list[i]);
            $group.append(inputs[i]);

            var serialize = function() {
                def.list = [];
                for (var i in inputs) {
                    def.list.push(inputs[i].val());
                }
                $input.val(JSON.stringify(def));
            };
            inputs[i].on('change', serialize);
            serialize();
        }
        $input.val(JSON.stringify(def));
    };

    $form.find('[data-definition]').each(function(i, input) {
        var def = JSON.parse($(input).val());
        Renderer.render(def, $(input));
    });

    var $container = $form.find('[data-definitions]');
    $form.find('[data-add-type]').on('click', function() {
        var type = $(this).data('add-type');
        var id = $container.find('[data-definition]').length;
        var $name = $('<input name="vars[' + id + '][name]" class="form-control">');
        var $input = $('<input name="vars[' + id + '][definition]" data-definition class="form-control">');
        $container.append($name).append($input);

        var defaults = {type: type};
        if (type === 'integer') {
            defaults.min = 0;
            defaults.max = 100;

        } else if (type === 'list') {
            defaults.list = [];

        } else if (type === 'plural') {
            defaults = {
                type: type,
                count: '<eval></eval>',
                one: '',
                few: '',
                many: ''
            };
        }
        Renderer.render(defaults, $input);
    });

    var $undo;
    var $pointer;
    var $undoLink;
    $container.find('[data-var-remove]').click(function(e) {
        if ($undoLink) {
            $undoLink.remove();
        }

        var $link = $(e.target);
        var $group = $container.find('[data-var-id="' + $link.data('var-remove') + '"]');
        $pointer = $('<div></div>');
        $group.after($pointer);
        $undoLink = $('<a class="btn btn-link"></a>').text($link.data('label-undo'))
            .on('click', function() {
                $pointer.after($undo);
                $pointer.remove();
                $undoLink.remove();
            });

        $group.after($undoLink);
        $group.detach();
        $undo = $group;
    });
})();

(function() {
    var margin = {top: 20, right: 20, bottom: 30, left: 40},
        width = 960 - margin.left - margin.right,
        height = 350 - margin.top - margin.bottom;

    var x = d3.scale.ordinal()
        .rangeRoundBands([0, width], .1);

    var y = d3.scale.linear()
        .range([height, 0]);

    var xAxis = d3.svg.axis()
        .scale(x)
        .orient("bottom");

    var yAxis = d3.svg.axis()
        .scale(y)
        .orient("left")
        ;//.ticks(10, "%");

    var svg = d3.select("body").append("svg")
        .attr("width", width + margin.left + margin.right)
        .attr("height", height + margin.top + margin.bottom)
        .append("g")
        .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

    var type = function(d) {
        d.x = d[0];
        d.y = +d[1];
        d.correct = d[2];
        d.score = d[3];
        return d;
    };

    var line = d3.svg.line()
        .x(function(d) { return x(d.x) + 13; }) // TODO offset must be dynamic
        .y(function(d) { return y(d.score * 50); });

    $('.column-chart').each(function() {
        $chart = $(this);
        $.ajax({
            url: $chart.data('url'),
            success: function(data) {
                data = data.map(type);
                x.domain(data.map(function(d) { return d.x; }));
                y.domain([0, d3.max(data, function(d) { return d.y; })]);

                svg.append("g")
                    .attr("class", "x axis")
                    .attr("transform", "translate(0," + height + ")")
                    .call(xAxis);

                svg.append("g")
                    .attr("class", "y axis")
                    .call(yAxis)
                    .append("text")
                    .attr("transform", "rotate(-90)")
                    .attr("y", 6)
                    .attr("dy", ".71em")
                    .style("text-anchor", "end")
                    .text($chart.data('y-title'));

                svg.selectAll(".bar")
                    .data(data)
                    .enter().append("rect")
                    .attr("class", function(d) { return 'column ' + (d.correct ? 'column-correct' : 'column-wrong'); })
                    .attr("x", function(d) { return x(d.x); })
                    .attr("width", x.rangeBand())
                    .attr("y", function(d) { return y(d.y); })
                    .attr("height", function(d) { return height - y(d.y); });

                svg.append("path")
                    .datum(data)
                    .attr("class", "line")
                    .attr("d", line);
            }
        });
    });
})();

$(function() {
	var previous;
	$('.editable').each(function() {
		var editor = new MediumEditor($(this), {
			buttons: ['bold', 'italic', 'anchor', 'header1'],
			disableDoubleReturn: true
		});
		$(this).on('input', function() {
			var text = editor.serialize()[$(this).attr('id')].value;
			if (previous) {
				previous.abort();
			}
			previous = $.ajax({
				url: $(this).data('url-save'),
				data: {text: text},
				type: 'POST',
				success: function(res) {
					if (!res.saved)
					{
						App.error(arguments);
					}
				},
				error: function(res) {
					App.error(arguments);
				}
			});
		});
	});
});

App.elasticSearch = new $.es.Client({
	hosts: 'http://vagrant.khanovaskola.cz:9200'
});

App.autocomplete = function(query, cb) {
	App.elasticSearch.search({
		index: 'khanovaskola',
		type: 'Video,Blueprint',
		body: {
			query: {
				match: {
					title: query
				}
			},
            highlight: {
                pre_tags: ['<strong>'],
                post_tags: ['</strong>'],
                fields: {
                    title: {
                        number_of_fragments: 0
                    }
                }
            }
		}
	}).then(function(results) {
		var titles = [];
		$.each(results.hits.hits, function(i, v) {
			titles.push({
				id: v._id,
                value: v._source.title,
				highlit: 'title' in v.highlight ? v.highlight.title[0] : v._source.title
			});
		});
		cb(titles);
	});
};

$(function() {
    $('#frm-search-form-query').typeahead(
        {
            hint: true,
            highlight: false,
            minLength: 1
        },
        {
            name: 'states',
            templates: {
                suggestion: function(row) {
                    return '<p>' + row.highlit + '</p>'
                }
            },
            source: function(query, process) {
                App.autocomplete(query, function(results) {
                    process(results);
                });
            }
        }
    );
});
